import './App.css';
import Layout from './components/shared/Layout';
import LayoutBlack from './components/shared/LayoutBlack';

function App() {
  return (
   <>
   <Layout>
    <h1>Welcome Jai</h1>
   </Layout>
   <LayoutBlack>
    <h1>Welcome Black</h1>
   </LayoutBlack>
   </>
  );
}

export default App;
